{"result":"@-moz-document domain('news.ycombinator.com') {
    body {
        background-color: rgb(26, 26, 26);
        color: rgb(245, 245, 245);
    }

    #hnmain td {
        color: rgb(245, 245, 245);
    }

    table {
        background-color: rgb(51, 51, 51);
    }

    table#hnmain {
        background-color: rgb(42, 42, 42);
    }

    table#hnmain table {
        background-color: rgb(42, 42, 42);
    }

    a, a:visited {
        color: rgb(85, 145, 219);
    }

    #pagespace {
        background-color: rgb(26, 26, 26);
    }

    .title, .subtext {
        color: rgb(245, 245, 245);
    }


    .title, .subtext a {
        color: rgb(145, 245, 245);
    }

    .yclinks a,
    a:link,
    .pagetop a:visited
    {
        color: rgb(150, 197, 255);
    }

    textarea, input[type="text"] {
        background: rgb(51, 51, 51);
        color: white;
    }

    input[type="submit"] {
        background: rgb(51, 51, 51);
        color: white;
    }

    .c00, .c00 a:link {
        color: rgb(235, 255, 245);
    }

    .comhead a:link {
        color: rgb(145, 255, 205);
    }

    .subtext a:link, .pagetop {
        color: rgb(145, 255, 205);
    }

    .subtext a:visited, #karma {
        color: rgb(145, 155, 105);
    }

    .subtext a:link[href^='flag?'] {
        color: rgb(255, 75, 75); /* Red color */
    }

    .subtext a:link[href^='hide?'] {
        color: rgb(225, 175, 175); /* Red color */
    }
}

@-moz-document url(https://news.ycombinator.com/newsguidelines.html), url(https://news.ycombinator.com/newsfaq.html), url(https://news.ycombinator.com/security.html) {
    table td {
        background-color: rgb(26, 26, 26);
        color: rgb(245, 245, 245);
        border: 0;
    }

    table,
    tbody,
    tr,
    td {
        background: transparent;
    }

    b {
        color: rgb(145, 245, 245);
    }
}"}
